class Solution {
    func beautifulSubstrings(_ s: String, _ k: Int) -> Int {
        let vowels = Set("aeiou")
        var result = 0
        let n = s.count
        var prefixVowels = [Int](repeating: 0, count: n + 1)
        var prefixConsonants = [Int](repeating: 0, count: n + 1)

        for i in 0..<n {
            prefixVowels[i + 1] = prefixVowels[i] + (vowels.contains(s[s.index(s.startIndex, offsetBy: i)]) ? 1 : 0)
            prefixConsonants[i + 1] = prefixConsonants[i] + (vowels.contains(s[s.index(s.startIndex, offsetBy: i)]) ? 0 : 1)
        }

        for i in 0..<n {
            for j in i + 1...n {
                let vowelsCount = prefixVowels[j] - prefixVowels[i]
                let consonantsCount = prefixConsonants[j] - prefixConsonants[i]
                if vowelsCount == consonantsCount && (vowelsCount * consonantsCount) % k == 0 {
                    result += 1
                }
            }
        }

        return result
    }
}
